import React from "react";
import Alumno from "./components/Alumno";
import "./App.css";

import { ToastContainer } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";

function App() {
  return (
    <div className="container p-4">
      <div className="row">
        <Alumno />
      </div>
      <ToastContainer />
    </div>
  );
}

export default App;
